Удобное приложение для клиентов автомойки "Колесо" - г Северодвинск, Архангельское ш. 59К стр.3.
Позволит Вам:
-Самостоятельно записаться на автомойку в удобное для Вас время или отменить заказ;
-Выбрать усуги при записи с просмотром подробного описания;
-Экономить свои деньги, получая бонусы при регистрации, за заказы, оплачивать ими услуги;
-Получать специальные предложения и учавствовать в акциях;
-Пользоваться всей семьей используя единый бонусный счёт на все автомобили;
-При необходимости прокладывать маршрут до автомойки с использованием любого внешнего навигатора;
